import './SelectFile.css'
export const SelectFile = ({fileName,action,selected}) => {
  return (
    <div onClick={()=>action()} className={`selectFile${selected===fileName?' selectFileActive':''}`}>
        <p>{fileName}</p>
    </div>
  )
}
